INSERT INTO `zt_history` VALUES ('123', '267', 'steps', '点击【制定方案】 EXPECT:进入移民工具界面\n点击【我的评估结果】 EXPECT:显示上一次的移民评估\n点击【适合我的移民方案】 EXPECT:1、进入移民方案界面，显示已生成，可查看；\r\n2、点击查看，打开该移民方案并可以进行预约咨询\n点击【快速匹配适合我的移民方案】 EXPECT:1、根据上一次做移民评估匹配项目；\r\n2、如果对之前已经做过一键出方案的项目再次出方案，就会把之前的覆盖；\r\n3、未出过方案的项目，一键出方案时进行递增。\n点击【我要做一下移民评估】 EXPECT:重新做移民评估\n', '点击【制定方案】 EXPECT:进入移民工具界面\n点击【我的评估结果】 EXPECT:显示上一次的移民评估\n点击【适合我的移民方案】 EXPECT:1、进入移民方案界面，显示已生成，可查看；\r\n\n点击查看 EXPECT:1、打开该移民方案；\r\n2、可以进行预约咨询\n点击预约咨询 EXPECT:显示出方案的顾问的信息，包含顾问的评价、姓名、手机号、QQ号、邮箱、微信号，\n点击电话 EXPECT:自动拨打顾问的电话\n点击评价 EXPECT:1、进入顾问评价界面；\r\n2包含：服务态度、专业知识、反馈效率、综合评价、其他建议等\n点击介绍 EXPECT:可以介绍其他客户\n点击解聘 EXPECT:可以解聘当前顾问\n', '004- <del>2、点击查看，打开该移民方案并可以进行预约咨询</del>\n004+ <ins></ins>\n005- <del>点击【快速匹配适合我的移民方案】 EXPECT:1、根据上一次做移民评估匹配项目；</del>\n005+ <ins>点击查看 EXPECT:1、打开该移民方案；</ins>\n006- <del>2、如果对之前已经做过一键出方案的项目再次出方案，就会把之前的覆盖；</del>\n006+ <ins>2、可以进行预约咨询</ins>\n007- <del>3、未出过方案的项目，一键出方案时进行递增。</del>\n007+ <ins>点击预约咨询 EXPECT:显示出方案的顾问的信息，包含顾问的评价、姓名、手机号、QQ号、邮箱、微信号，</ins>\n008- <del>点击【我要做一下移民评估】 EXPECT:重新做移民评估</del>\n008+ <ins>点击电话 EXPECT:自动拨打顾问的电话</ins>\n009+ <ins>点击评价 EXPECT:1、进入顾问评价界面；</ins>\n010+ <ins>2包含：服务态度、专业知识、反馈效率、综合评价、其他建议等</ins>\n011+ <ins>点击介绍 EXPECT:可以介绍其他客户</ins>\n012+ <ins>点击解聘 EXPECT:可以解聘当前顾问</ins>');
