INSERT INTO `zt_history` VALUES ('686', '1896', 'steps', '<p></p><p class=\"MsoListParagraph\" style=\"margin-left:49.6pt;text-indent:-1cm;\">&nbsp;验证手机号是否已输入，若未输入，提示“请输入手机号”<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.6pt;text-indent:-1cm;\">&nbsp;如长度有误提示：“手机号码长度不是<span>11</span>位，请重新输入”<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.6pt;text-indent:-1cm;\">如号段格式有误，提示：“手机号格式不正确，请重新输入”<span></span></p>\n\n<p><br /></p>', '<p class=\"MsoListParagraph\" style=\"margin-left:49.6pt;text-indent:-1cm;\">1、 验证手机号是否已输入，若未输入，提示“请输入手机号”</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.6pt;text-indent:-1cm;\"><span style=\"line-height:1.57143;\">&nbsp;2、如长度有误提示：“手机号码长度不是</span><span style=\"line-height:1.57143;\">11</span><span style=\"line-height:1.57143;\">位，请重新输入”</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.6pt;text-indent:-1cm;\"><span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.6pt;text-indent:-1cm;\">3、如号段格式有误，提示：“手机号格式不正确，请重新输入”</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.6pt;text-indent:-1cm;\">4、<span style=\"line-height:1.57143;\">倒计时结束后按钮变更“重新获取”用户可点击发送新的验证码，则原有验证码失效。提示：“该验证码已失效，请重新输入”</span><span style=\"line-height:1.57143;\"></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.6pt;text-indent:-1cm;\"><span style=\"line-height:1.57143;\">5、验证验证码是否为正确，如输入错误，提示验证码输入错误，请重试！</span></p>', '001- <del><p></p><p class=\"MsoListParagraph\" style=\"margin-left:49.6pt;text-indent:-1cm;\">验证手机号是否已输入，若未输入，提示“请输入手机号”<span></span></p></del>\n001+ <ins><p class=\"MsoListParagraph\" style=\"margin-left:49.6pt;text-indent:-1cm;\">1、 验证手机号是否已输入，若未输入，提示“请输入手机号”</p></ins>\n002- <del><p class=\"MsoListParagraph\" style=\"margin-left:49.6pt;text-indent:-1cm;\">如长度有误提示：“手机号码长度不是<span>11</span>位，请重新输入”<span></span></p></del>\n002+ <ins><p class=\"MsoListParagraph\" style=\"margin-left:49.6pt;text-indent:-1cm;\"><span style=\"line-height:1.57143;\">2、如长度有误提示：“手机号码长度不是</span><span style=\"line-height:1.57143;\">11</span><span style=\"line-height:1.57143;\">位，请重新输入”</span></p></ins>\n003- <del><p class=\"MsoListParagraph\" style=\"margin-left:49.6pt;text-indent:-1cm;\">如号段格式有误，提示：“手机号格式不正确，请重新输入”<span></span></p></del>\n003+ <ins><p class=\"MsoListParagraph\" style=\"margin-left:49.6pt;text-indent:-1cm;\"><span></span></p></ins>\n004- <del></del>\n004+ <ins><p class=\"MsoListParagraph\" style=\"margin-left:49.6pt;text-indent:-1cm;\">3、如号段格式有误，提示：“手机号格式不正确，请重新输入”</p></ins>\n005- <del><p><br /></p></del>\n005+ <ins><p class=\"MsoListParagraph\" style=\"margin-left:49.6pt;text-indent:-1cm;\">4、<span style=\"line-height:1.57143;\">倒计时结束后按钮变更“重新获取”用户可点击发送新的验证码，则原有验证码失效。提示：“该验证码已失效，请重新输入”</span><span style=\"line-height:1.57143;\"></span></p></ins>\n006+ <ins><p class=\"MsoListParagraph\" style=\"margin-left:49.6pt;text-indent:-1cm;\"><span style=\"line-height:1.57143;\">5、验证验证码是否为正确，如输入错误，提示验证码输入错误，请重试！</span></p></ins>');
